import React, { Component } from "react";
import Education from "./education";

class EducationsHandler extends Component {
  constructor(props) {
    super(props);

    this.state = {
      educations: 3,
    };
    this.createForms = this.createForms.bind(this);
  }

  createForms() {
    let formsArray = [];
    var i;
    for (i = 1; i < this.state.educations; i++) {
      formsArray = [...formsArray, <Education educationID=""></Education>];
    }
    formsArray = [
      ...formsArray,
      <Education edit="true" educationID=""></Education>,
    ];
    return formsArray;
  }

  render() {
    return <div>{this.createForms()}</div>;
  }
}

export default EducationsHandler;
